BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "VersionInfo" (
	"Version"	INTEGER NOT NULL,
	"AppliedOn"	DATETIME,
	"Description"	TEXT
);
CREATE TABLE IF NOT EXISTS "Players" (
	"Id"	INTEGER NOT NULL,
	"PlayerId"	TEXT NOT NULL,
	"Name"	TEXT NOT NULL,
	"Hunger"	INTEGER NOT NULL DEFAULT 0,
	"Health"	INTEGER NOT NULL DEFAULT 0,
	"Money"	INTEGER NOT NULL DEFAULT 0,
	"Horse"	TEXT,
	"HorseHarness"	TEXT,
	"Equipment_0"	TEXT,
	"Equipment_1"	TEXT,
	"Equipment_2"	TEXT,
	"Equipment_3"	TEXT,
	"Armor_Head"	TEXT,
	"Armor_Body"	TEXT,
	"Armor_Leg"	TEXT,
	"Armor_Gloves"	TEXT,
	"Armor_Cape"	TEXT,
	"FactionIndex"	INTEGER NOT NULL DEFAULT 0,
	"Class"	TEXT NOT NULL DEFAULT 'pe_peasant',
	"PosX"	NUMERIC NOT NULL DEFAULT 0,
	"PosY"	NUMERIC NOT NULL DEFAULT 0,
	"PosZ"	NUMERIC NOT NULL DEFAULT 0,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Inventories" (
	"Id"	INTEGER NOT NULL,
	"PlayerId"	TEXT,
	"InventoryId"	TEXT NOT NULL,
	"IsPlayerInventory"	INTEGER NOT NULL,
	"InventorySerialized"	TEXT NOT NULL,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Factions" (
	"Id"	INTEGER NOT NULL,
	"FactionIndex"	INTEGER NOT NULL,
	"Name"	TEXT NOT NULL,
	"BannerKey"	TEXT NOT NULL,
	"LordId"	TEXT,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Castles" (
	"Id"	INTEGER NOT NULL,
	"MissionObjectHash"	TEXT NOT NULL,
	"CastleIndex"	INTEGER NOT NULL,
	"FactionIndex"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "UpgradeableBuildings" (
	"Id"	INTEGER NOT NULL,
	"MissionObjectHash"	TEXT NOT NULL,
	"IsUpgrading"	INTEGER NOT NULL DEFAULT 0,
	"CurrentTier"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "StockpileMarkets" (
	"Id"	INTEGER NOT NULL,
	"MissionObjectHash"	TEXT NOT NULL,
	"MarketItemsSerialized"	TEXT NOT NULL,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HorseMarkets" (
	"Id"	INTEGER NOT NULL,
	"MissionObjectHash"	TEXT NOT NULL,
	"Stock"	INTEGER NOT NULL,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE UNIQUE INDEX IF NOT EXISTS "UC_Version" ON "VersionInfo" (
	"Version"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "IX_Players_PlayerId" ON "Players" (
	"PlayerId"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "IX_Factions_FactionIndex" ON "Factions" (
	"FactionIndex"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "IX_Castles_CastleIndex" ON "Castles" (
	"CastleIndex"	ASC
);
COMMIT;
